import { Component, Input, OnInit } from '@angular/core';

import { Ideck } from 'src/app/interfaces/Ideck';
import { MatDialog } from '@angular/material/dialog';

@Component({
  selector: 'app-deckdetails',
  templateUrl: './deckdetails.component.html',
  styleUrls: ['./deckdetails.component.scss']
})
export class DeckDetailsComponent implements OnInit {

  public deck: Ideck = {
    id: 0,
    cards: [],
    name: '',
    userEmail: ''
  };

  public cards: Array<Ideck> = [];

  constructor() { }

  ngOnInit(): void {

  }

}
<h2 mat-dialog-title>Install Angular</h2>
<mat-dialog-content class="mat-typography hidden">
  <h3>Name</h3>
  <p>{{this.deck.name}}</p>

  <h3>Number of cards</h3>
  <p>{{this.deck.cards.length}}</p>
</mat-dialog-content>
<mat-dialog-actions align="end">
  <button mat-button mat-dialog-close>Close</button>
</mat-dialog-actions>
